import React from 'react'
import './GlobalFilter.css';

export const GlobalFilter = ({ filter, setFilter }) => {
    return (
        <span className="search">
            <input placeholder="Search..." value={filter || ''} onChange={e => setFilter(e.target.value)} /> 
        </span>
    )
}
